import React from 'react';
import './NewLift.scss';

const NewLift = props => {
  return (
    <div id="new-lift">
      <button type="button" onClick={props.toggleModal} className="button-one">
        CANCEL
      </button>
    </div>
  );
};

export default NewLift;
